import React from "react";
import { Link } from "react-router-dom";

function SideBar(){
    const [isOpen, setIsOpen] = useState(false);
    return (
        <>
          <div>
            <div style={{ width: isOpen ? "200px" : "70px" }} className={`sidebar`}>
              <div className="top_section">
                <h1 style={{ display: isOpen ? "block" : "none" }} className="logo">
                  IKAA
                </h1>
                <div
                  style={{ marginLeft: isOpen ? "50px" : "0px" }}
                  className="bars"
                >
                </div>
              </div>
              <div className="bottomSection">
                <Link className="link" activeclassname="active" to={"/login"}>
                  <div className="icon">
                  </div>
                  <div
                    style={{ display: isOpen ? "block" : "none" }}
                    className="link_text"
                  >
                    DashBoard
                  </div>
                </Link>
    
                {user?.userType === "patient" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/patientprofile"}
                  >
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Profile
                    </div>
                  </Link>
                ) : null}
    
                {user?.userType === "patient" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/bookappointment"}
                  >
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Book Appointment
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "admin" ? (
                  <Link className="link" activeclassname="active" to={"/addoctor"}>
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Add Doctor
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "admin" ? (
                  <Link className="link" activeclassname="active" to={"/addnurse"}>
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Add Nurse
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "admin" ? (
                  <Link className="link" activeclassname="active" to={"/admin"}>
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Add Admin
                    </div>
                  </Link>
                ) : null}
    
                {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/doctorprofile"}
                  >
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Profile
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/checkappointment"}
                  >
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Appointments
                    </div>
                  </Link>
                ) : null}
                {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/createslip"}
                  >
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Create Report
                    </div>
                  </Link>
                ) : null}
                {/* {user?.userType === "doctor" ? (
                  <Link
                    className="link"
                    activeclassname="active"
                    to={"/patientdetails"}
                  >
                    <div className="icon">
                      <TbListDetails className="mainIcon" />
                    </div>
                    <div
                      style={{ display: isOpen ? "block" : "none" }}
                      className="link_text"
                    >
                      Patients
                    </div>
                  </Link>
                ) : null} */}
    
                <Link
                  className="LogOutPath link"
                  onClick={() => {
                    dispatch({ type: "AUTH_LOGOUT" });
                  }}
                  to={"/"}
                >
                  <div
                    style={{ display: isOpen ? "block" : "none" }}
                    className="link_text"
                  >
                    Logout
                  </div>
                </Link>
              </div>
            </div>
          </div>
        </>
      );
    };
    
export default SideBar;
